import React, {FC, useEffect, useState} from "react";
import { ITask } from "../interface/interface";
import httpQuery  from '../httpQuery/httpQuery'

const Task: FC = () => {

    const [tasks, setTask] = useState<ITask[]>([])

    useEffect(() => {
        const getAllTasks = async (): Promise<ITask[] | void> => {
            try {
                const response = await httpQuery.get<ITask[]>('/allTasks')
                const result = response.data
                return setTask(result)
            } catch (e) {
                console.log('I`M Error on GET query!', e)
            }
        }
        getAllTasks().then(res => console.log(res))
        }, [])


    return(
        <>
            <div>{tasks.map(task => {
                <li></li>
            })}</div>
        </>
    )
}
export default Task
